DROP DATABASE IF EXISTS cms_db;

CREATE DATABASE IF NOT EXISTS cms_db;

USE cms_db;

SET GLOBAL event_scheduler = "ON";

CREATE TABLE IF NOT EXISTS `systemdata`(
`SystemId` varchar (20),
`SystemName` varchar (50),
`Telephone1` varchar(100),
`Telephone2` varchar(100),
`Email` varchar(50),
`Website` varchar(100),
`Image` varchar(250),
`AccName` varchar(250),
`DirName` varchar(250),
`HeadName` varchar(250),
`Bank1` varchar(250),
`Bank2` varchar(250),
`Bank3` varchar(250),
`Bank1Acc` varchar(250),
`Bank2Acc` varchar(250),
`Bank3Acc` varchar(250),
`Location` varchar(250),
`Address` varchar(250),
`Initials` varchar(250),
`UserId` varchar(20),
`Slogan` varchar(100),
`Version` varchar(50),
`DefaultLanguage` varchar(20) DEFAULT 'en',
`AddedId` varchar(20),
`AddedDate` datetime DEFAULT current_timestamp(),
`UpdatedDate` datetime,
`UpdatedId` varchar(60),
`UpdatedNotes` text,
`Status` varchar(10) DEFAULT 'ACTIVE',
`Archived` varchar(10) DEFAULT 'NO',
`ArchiveId` varchar(10),
`ArchiveDate` datetime,
`ArchiveTime` datetime,
PRIMARY KEY (`SystemId`)
)ENGINE=INNODB;
