CREATE TABLE IF NOT EXISTS `services`(
`ServiceId` varchar (20),
`ServiceType` varchar(50),
-- `Category` varchar(250),
`Duration` varchar(50),
`AddedDate` datetime DEFAULT current_timestamp(),
`UpdatedDate` datetime,
`UpdatedId` varchar(60),
`AddedId` varchar(60),
`UpdatedNotes` text,
`Status` varchar(10) DEFAULT 'ACTIVE',
`Archived` varchar(10) DEFAULT 'NO',
`ArchiveId` varchar(10),
`ArchiveDate` datetime,
`UserId` datetime,
`ArchiveTime` datetime,
PRIMARY KEY(`ServiceId`)
)ENGINE=INNODB;

CREATE TABLE IF NOT EXISTS `newconverts`(
`ConvertId` varchar (20),
`ShepherdId` varchar (20),
-- `MemberType` varchar (20),
`BacentaId` varchar (20),
`EducationId` varchar (20),
`CertificateId` varchar (20),
`Firstname` varchar(50),
`Lastname` varchar(50),
`Fullname` varchar(200) GENERATED ALWAYS AS (CONCAT(Firstname,' ',Lastname)),
`Address` varchar (50),
`Occupation` varchar (50),
`Telephone1` varchar(20),
`Telephone2` varchar(20),
`Gender` varchar(20),
`Email` varchar(50),
`MaritalStatus` varchar(50),
-- `EduBackground` varchar(50),
`Mode` varchar(50) DEFAULT 'NEW-USER' COMMENT 'new user notifications',
`AgeRange` varchar(150),
`Image` varchar(250),
`Country` varchar(20),
-- `Religion` varchar(20),
`Region` varchar(20),
`AddedId` varchar(20),
`DOB` date,
`TitleId` varchar(20),
`AddedDate` datetime DEFAULT current_timestamp(),
`UpdatedDate` datetime,
`UpdatedId` varchar(60),
`UpdatedNotes` text,
`Status` varchar(10) DEFAULT 'ACTIVE',
`Archived` varchar(10) DEFAULT 'NO',
`ArchiveId` varchar(10),
`UserId` varchar(10),
`ArchiveDate` datetime,
`ArchiveTime` datetime,
PRIMARY KEY(`ConvertId`)
)ENGINE=INNODB;
